import React from 'react';
import { Link } from 'react-router-dom';
import './index.scss'



const Sidebar = () => {
    return (
        <div className='nav-bar'>
            <link className='logo' to="/">
              this is text
            </link>
        </div>
    );
};

export default Sidebar;
